import React from 'react';
import Button from '@material-ui/core/Button';
import { Sidebar } from '../../components';
import { MenuPopupState } from '../../components/Account/AccountButton';
import './style.scss';
import { MembersList } from './components/MembersList';
import { UserList } from './components/UserList';
import { Link } from 'react-router-dom';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

export const Account = () => {
	return (
		<div className='page-wrapper'>
			<div className='page-left'>
				<div className='page_sidebar'>
					<Sidebar />
				</div>
			</div>
			<div className='page-right'>
				<div className='page_menu'>
					<MenuPopupState />
				</div>
				<div className='Account'>
					<div className='Account__title'>
						<Button variant='outlined'>
							<Link to='/members-list'>Danh Sách Thành Viên</Link>
							<Route component={MembersList} />
						</Button>
						<Button variant='outlined'>Danh Sách Users</Button>
						<Button variant='outlined'>Phân Quyền</Button>
					</div>
					<div className='Account__content'>
						<MembersList />
						<UserList />
					</div>
				</div>
			</div>
		</div>
	);
};
